import React from 'react';
import {connect} from 'redux-bundler-react';
import classnames from 'classnames';

class HelpButton extends React.Component{
    render(){

        return (
                <a className="btn btn-outline-info mr-2" href='https://hydrologicengineeringcenter.github.io/NSI/' target='_blank'>
                    <i className="ms ms-help" title="Get Help."></i>
                </a>
        )
    }
}
export default connect(
    HelpButton
)
